B.Du=new A.d_("Introduction","This Privacy Policy helps you understand what information we collect at Calotrek, how we use it, and what choices you have regarding your data. Calotrek is developed by AppDoc Developer as a free application. This SERVICE is provided at no cost and is intended for use as is.\n\nBy choosing to use our Service, you agree to the collection and use of information in accordance with this policy. The Personal Information we collect is used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy. The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, unless otherwise defined herein.")
B.DB=new A.d_("Information Collection and Use","For a better experience while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to:\n\n- Name\n- Email address\n- Gender\n- Location\n- Weight\n- Height\n- Basal Metabolic Rate (BMR)\n- Calorie Reduction Plan\n- Body Mass Index (BMI)\n- Meal intake pictures\n- Meal intake history\n\nThe information that we request will be retained by us and used as described in this Privacy Policy. The app may use third-party services that may collect information used to identify you.")
B.Dx=new A.d_("Cookies","Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the website that you visit and are stored on your device\u2019s internal memory.\n\nThis Service does not use these \u201ccookies\u201d explicitly. However, the app may use third-party code and libraries that utilize cookies to collect information and improve their services. You have the option to accept or refuse these cookies and to know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.")
B.Dz=new A.d_("Location Information","Some of the services may use location information transmitted from users' mobile phones. We only use this information within the scope necessary for the designated service.")
B.DA=new A.d_("Device Information","We collect information from your device in some cases. The information will be utilized for the provision of better service and to prevent fraudulent acts. Additionally, such information will not include details that would identify the individual user.")
B.Dw=new A.d_("Service Providers","We may employ third-party companies and individuals for the following reasons:\n\n- To facilitate our Service\n- To provide the Service on our behalf\n- To perform Service-related services\n- To assist us in analyzing how our Service is used\n\nThese third parties may have access to your Personal Information to perform their assigned tasks on our behalf. However, they are obligated not to disclose or use the information for any other purpose.")
B.Dt=new A.d_("Security","We value your trust in providing us with your Personal Information, and we strive to use commercially acceptable means of protecting it. However, no method of transmission over the Internet or electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.")
B.Ds=new A.d_("Children\u2019s Privacy","This Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13. If we discover that a child under 13 has provided us with personal information, we will immediately delete this from our servers.\n\nIf you are a parent or guardian and are aware that your child has provided us with personal information, please contact us so that we can take the necessary actions.")
B.Dy=new A.d_("Changes to This Privacy Policy","We may update our Privacy Policy from time to time. You are advised to review this page periodically for any changes. We will notify you of any updates by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted.")
B.Dv=new A.d_("Contact Us","If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us.\n\nEmail: support@calotrek.com")
